import React from "react";
import SearchManga from "./SearchManga";
import MangaBanner from "./MangaBanner";

function Manga() {
  return (
    <div>
      <br />
      <br />
      <MangaBanner />
      <SearchManga />
    </div>
  );
}

export default Manga;
